import React from 'react'
import Card from './Card'

const CardList = ({robots}) => {
    return ( 
      robots.map((robo,index)=>{
          return <Card id={robo[index].id} name={robo[index].name} email={robo.email}></Card>
      })

    )
}
export default CardList
